import React from "react";
import "./App.css";
import Landing_page from "./screens/landing_page/Landing_page";
import Footer from "./screens/landing_page/footer/Footer";
import Navbar from "./screens/landing_page/navbar/Navbar";
import {BrowserRouter, Route, Switch ,Router} from "react-router-dom";
import Timeline from "./screens/timeline/Timeline";
import Login_home from "./screens/landing_page/login_home/Login_home";

class App extends React.Component {


  render() {
    return (
      <BrowserRouter>
        <Navbar />
       <Switch>
          <Route exact path="/" component={Landing_page} />  
          <Route path="/timeline" component={Timeline} />
          <Route path="/login" component={Login_home} />
        </Switch>
        <Footer />
      </BrowserRouter>
    );
  }
}
// camel case notation
export default App;
